commits.content:
// assets
import { FontSizeOutlined } from '@ant-design/icons';

// icons
const icons = {
    FontSizeOutlined
};

// ==============================|| MENU ITEMS - UTILITIES ||============================== //

const adminmm = {
    id: 'adminmm',
    title: 'Admin',
    type: 'group',
    children: [
        {
            id: 'admin-management',
            title: 'Admin Management',
            type: 'item',
            url: '/adminManagement',
            icon: icons.FontSizeOutlined
        }
    ]
};

export default adminmm;
